import React from "react";
import styled from "styled-components";

import Back from "../../assets/back.png";
import Dots from "../../assets/dots.png";

export default function Top() {
  return (
    <>
      <BalanceDiv>
        <BalanceImgs src={Back} alt="back" />
        <BalanceImgs src={Dots} alt="3 dots" />
      </BalanceDiv>
      <H3>Check balance</H3>
      <Savings>Savings account</Savings>
      <StateBank>State Bank of India 1955</StateBank>
    </>
  );
}

const BalanceDiv = styled.div`
  display: flex;
  align-items: center;
  padding: 20px 20px;
  justify-content: space-between;
`;
const BalanceImgs = styled.img`
  width: 20px;
  display: block;
`;
const H3 = styled.h3`
  margin: 20px;
  font-weight: 400;
  font-size: 24px;
`;
const Savings = styled.p`
  margin: 50px 20px 0;
  font-weight: 400;
  font-size: 16px;
`;
const StateBank = styled.p`
  margin: -10px 20px 0;
  font-weight: 300;
  font-size: 14px;
`;
